      awayTeam: this.awayTeam,
      awayTeam: this.goalsHomeTeam,
      goalsAwayTeam: this.goalsAwayTeam,
      score: this.score
    };

    return full
      ? {
          ...view,
          createdAt: this.createdAt,
          updatedAt: this.updatedAt,
          updatedBy: this.updatedBy
        }
      : view;
  }
};

